                <li><strong>"No puede desaparecer?"</strong> - Funciona en miles de computadoras en todo el mundo. Tendras que apagar todo internet para detenerlo.</li>
                <li><strong>"No es muy tarde para entrar?"</strong> - Solo el 2% del mundo tiene Bitcoin. Estamos MUY temprano.</li>
                <li><strong>"Y si el gobierno lo prohbe?"</strong> - China lo prohibi 10 veces y sigue funcionando. Es imposible de detener.</li>
